import Layout from '../Components/Layout';
import fetch from 'isomorphic-unfetch';
import React from 'react';
import Forms from '../Components/Forms';

const index = (props)=> (
<Layout>
   <div>


    <style global jsx>{`
  body{
      background: #333;
  }
  
  
  `}</style>
    </div>
    </Layout>
  
    );

        <Forms />
       
    
   
    export default index;
